var title_f16_4_16459="Consensus statements on driving and epilepsy";
var content_f16_4_16459=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F71502&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F71502&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    AAN, AES, and EF of America consensus on driving and epilepsy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        1. The licensing decision should be made by the state Department of Motor Vehicles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. A seizure-free interval should be stated, and three months is preferred, starting from the date of the seizure. Both favorable and unfavorable modifiers (see text) could alter the interval.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Physicians should not be required to report their patients to the Department of Motor Vehicles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. The patient should be responsible to self-report.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Physicians should be given specific legal immunity for their patient reports and recommendations to regulators.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. A Medical Advisory Board or similar body composed of a least one member with expertise and experience in treating epilepsy should function in each state.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Consensus statements, sample statutory provisions, and model regulations regarding driver licensing and epilepsy. American Academy of Neurology, American Epilepsy Society, and Epilepsy Foundation of America. Epilepsia 1994; 35:696.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
