var title_f16_4_16460="Treatment of BP fistula";
var content_f16_4_16460=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F75185&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F75185&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Experimental therapies that have been tried in ventilated patients with bronchopleural fistula",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Technique",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Independent lung ventilation",
"       </td>",
"       <td>",
"        Requires double-lumen tube, more difficult to manage in ICU than in",
"        <strong>",
"         OR",
"        </strong>",
"        ; can be done with one or two ventilators, with or without synchronization; literature consists of anecdotal cases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High-frequency jet ventilation",
"       </td>",
"       <td>",
"        Uncontrolled clinical series from three groups, plus numerous",
"case reports; most (not all) report decreased leak volume, but",
"maintaining oxygenation is a problem in patients with ARDS; none of the",
"devices used in reported literature are currently FDA-approved for use",
"on adult patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chest tube occlusion during inspiration",
"       </td>",
"       <td>",
"        Two case reports, three patients total; leaks decreased; this technique becomes impractical as number of chest tubes increases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Application of PEEP to chest tube",
"       </td>",
"       <td>",
"        Four reports, six patients; leak decreased in five; lung",
"could not be kept inflated in two patients; leaks tended to decrease;",
"this technique is also impractical with increasing numbers of chest",
"tubes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Bronchoscopic identification of affected bronchus, with leak occlusion by:",
"       </td>",
"       <td colspan=\"1\" rowspan=\"11\">",
"        All individual case reports or two to five patient case",
"series except for one series of 24 post-surgical patients treated with",
"multiple silver nitrate applications; all reports are favorable,",
"showing either decrease or cessation of leak",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Balloon",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Bronchial plug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Lead fishing weight",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Gelfoam",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Oxidized regenerated cellulose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Tetracycline",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Silver nitrate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fibrin, autologous or commercial",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Cyanoacrylate-based tissue glue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Nd-YAG laser",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
