var title_f16_4_16461="Swallowing therapy";
var content_f16_4_16461=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F81927&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F81927&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Swallowing therapy techniques, indications, and rationale",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Technique",
"      </td>",
"      <td class=\"subtitle1\">",
"       Execution, rationale",
"      </td>",
"      <td class=\"subtitle1\">",
"       Indication",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"       Dietary modification",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Thickened liquids",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Reduced tendency to spill over tongue base",
"       </p>",
"       <p>",
"        Preswallow spill/aspiration",
"       </p>",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Disordered tongue function",
"       </p>",
"       <p>",
"        Impaired laryngeal closure",
"       </p>",
"       <p>",
"        Weak pharyngeal contraction",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Thin liquids",
"      </td>",
"      <td>",
"       Offers less resistance to flow",
"      </td>",
"      <td>",
"       Reduced cricopharyngeal opening",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"       Maneuvers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Supraglottic swallow",
"      </td>",
"      <td>",
"       Breath hold, double swallow, forceful expiration (closes vocal folds before and during swallowing)",
"      </td>",
"      <td>",
"       Aspiration: reduced/late vocal fold closure",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Super-supraglottic swallow",
"      </td>",
"      <td>",
"       <p>",
"        Effortful breath hold (closes vocal folds before and during swallow)",
"       </p>",
"       <p>",
"        Increased anterior tilting of arytenoids",
"       </p>",
"      </td>",
"      <td>",
"       Aspiration (poor closure of laryngeal introitus)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Effortful swallow",
"      </td>",
"      <td>",
"       Effortful tongue action (increases posterior motion tongue base)",
"      </td>",
"      <td>",
"       Poor posterior tongue base motion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Mendelsohn maneuver",
"      </td>",
"      <td>",
"       Prolong hyoid excursion guided by manual palpation (prolongs UES opening)",
"      </td>",
"      <td>",
"       Poor pharyngeal clearance and laryngeal movement",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"       Postural adjustments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"1\" rowspan=\"2\">",
"       Head tilt",
"      </td>",
"      <td>",
"       Tilt posteriorly at swallow initiation (gravity clears oral cavity)",
"      </td>",
"      <td>",
"       Poor tongue control",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tilt laterally to unaffected side (directs bolus down stronger side)",
"      </td>",
"      <td>",
"       Unilateral pharyngeal weakness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Chin tuck",
"      </td>",
"      <td>",
"       Chin down (widens valleculae, displaces tongue base and epiglottis posteriorly)",
"      </td>",
"      <td>",
"       Aspiration, delayed pharyngeal response, reduced posterior tongue base motion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Head rotation",
"      </td>",
"      <td>",
"       Rotate head to affected side (isolates damaged side from bolus path, reduces LES pressure)",
"      </td>",
"      <td>",
"       Unilateral pharyngeal weakness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"1\" rowspan=\"1\">",
"       Head rotation",
"      </td>",
"      <td>",
"       Rotate head to affected side with extrinsic pressure on thyroid cartilage (increases adduction)",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Unilateral laryngeal dysfunction",
"       </p>",
"       <p>",
"        Unilateral pharyngeal dysfunction",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Lying on side, elevation",
"      </td>",
"      <td>",
"       R or L lateral (bypass laryngeal introitus)",
"      </td>",
"      <td>",
"       Aspiration, bilateral pharyngeal impairment or reduced laryngeal elevation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"       Facilitatory techniques",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Strengthening exercises",
"      </td>",
"      <td>",
"       Various",
"      </td>",
"      <td>",
"       Nonprogressive disease",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Biofeedback",
"      </td>",
"      <td>",
"       Augment volitional component",
"      </td>",
"      <td>",
"       Poor pharyngeal clearance",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Thermal stimulation",
"      </td>",
"      <td>",
"       Cold, tactile stimulation to anterior faucial pillar",
"      </td>",
"      <td>",
"       Delayed/absent swallow response",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Gustatory stimulation",
"      </td>",
"      <td>",
"       Sour bolus (facilitates swallow response)",
"      </td>",
"      <td>",
"       Huntington's chorea, stroke",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Cook, IJ, Kahrilas, PJ. AGA: Technical review: Management of oropharyngeal dysphagia. Gastroenterology 1999; 116:455.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
